sourcesContent:
import styled from "styled-components";

export const Wrapper = styled.div`
    background-color: var(--darkGrey)
    width: 100%;
`;

export const Content = styled.div`

.image_carousel_container {
    list-style: none;
    height: 300px;
    position: relative;
    width: 100%;
}

.carousel_image {
    width: 100%;
}
`;
